const client = new ApolloClient({
    uri: 'https://api.example.com/graphql', // Замените на URL вашего GraphQL API
    cache: new InMemoryCache(),
});

const App: React.FC = () => {
    return (
        <ApolloProvider client={client}>
            <UserList />
        </ApolloProvider>
    );
};
export default App;
